total_costs0 = [sum(cost_values0[:i+1]) for i in range(len(cost_values0))]
total_costs1 = [sum(cost_values1[:i+1]) for i in range(len(cost_values1))]

# Create a line plot
plt.plot(time_periods0, total_costs0, marker='o', label='Within cluster redistribution')
plt.plot(time_periods1, total_costs1, marker='o', label='Across cluster redistribution')

# Add labels and title
plt.xlabel('Time')
plt.ylabel('Total Cost')
plt.title('Total Cost Comparison')
plt.legend()

# Setting the x-axis limit to the minimum time period of both datasets and the maximum time period
plt.xlim(min(min(time_periods0), min(time_periods1)), max(max(time_periods0), max(time_periods1)))

plt.show()